CREATE TABLE IF NOT EXISTS `stud_info` (
  `idnum` int(5) unsigned zerofill NOT NULL DEFAULT '00000',
  `idext` varchar(4) NOT NULL DEFAULT ' ',
  `lname` varchar(25) NOT NULL DEFAULT ' ',
  `fname` varchar(25) NOT NULL DEFAULT ' ',
  `mi` varchar(25) NOT NULL DEFAULT ' ',
  `addb` varchar(25) NOT NULL DEFAULT ' ',
  `addt` varchar(25) NOT NULL DEFAULT ' ',
  `addp` varchar(25) NOT NULL DEFAULT ' ',
  `gender` varchar(6) NOT NULL DEFAULT ' ',
  `bdate` date NOT NULL DEFAULT '0000-00-00',
  `status` varchar(10) NOT NULL DEFAULT ' ',
  `father` varchar(45) DEFAULT NULL,
  `mother` varchar(45) DEFAULT NULL,
  `foccup` varchar(30) DEFAULT NULL,
  `moccup` varchar(30) DEFAULT NULL,
  `addparents` varchar(45) DEFAULT NULL,
  `remarks` varchar(100) DEFAULT NULL,
  `prp_code` int(3) unsigned DEFAULT NULL,
  PRIMARY KEY (`idnum`),
  KEY `FK_stud_info_1` (`prp_code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

